import React, { Component } from "react";

export class User extends Component {
  componentDidMount() {
    this.props.getUser(this.props.match.params.login);
  }

  render() {
    const { name, avatar_url, location, bio, html_url, public_repos } =
      this.props.user;
    const { loading } = this.props;

    return <div>{name}</div>;
  }
}

export default User;
